int wuffs_peek_frames(FILE * fd, decoder_instance * instance, int(on_frame)(uint32_t, uint32_t, uint32_t, uint32_t)) {
  wuffs_gif__decoder *dec      = &instance->dec;
  wuffs_base__frame_config *fc = &instance->fc;
  wuffs_base__io_buffer *src   = &instance->src;

  // read remaining bytes, if any
  int bytes_read = src->meta.closed ? 0 : 1;
  while (bytes_read > 0) {
    bytes_read = wuffs_read_bytes(fd, DEFAULT_BYTES_PER_CHUNK, src);
    printf("bytes_read: %d\n", bytes_read);
  }

  int num_frames = 0;

  bool is_opaque;
  uint32_t io_position;
  wuffs_base__flicks delay_micros;

  while (true) {
    wuffs_base__status dfc_status = wuffs_gif__decoder__decode_frame_config(dec, fc, src);
    if (!wuffs_base__status__is_ok(&dfc_status)) {
      if (dfc_status.repr == wuffs_base__note__end_of_data) {
        // printf("[wuffs] End of data.\n");
        break;
      }
      printf("[wuffs] Error: %s\n", wuffs_base__status__message(&dfc_status));
      return -1;
    }

    is_opaque = wuffs_base__frame_config__opaque_within_bounds(fc);
    io_position = wuffs_base__frame_config__io_position(fc);
    delay_micros = (1000 * wuffs_base__frame_config__duration(fc)) / WUFFS_BASE__FLICKS_PER_MILLISECOND;

    if (on_frame(num_frames++, io_position, is_opaque, delay_micros) != 0) {
      // printf("stop requested!\n");
      break; // stop requested
    }
  }

  return num_frames;
}

int wuffs_read_file(const char * filename, wuffs_base__io_buffer * src) {
  size_t size;
  uint8_t * data = read_full_file(filename, &size);
  if (data == NULL)  return -1;

  src->data.ptr = data;
  src->data.len = size;
  src->meta.wi = size;
  src->meta.ri = 0;
  src->meta.pos = 0;
  src->meta.closed = true;
  return size;
}

