int wuffs_chunk_reader(FILE * fp, wuffs_base__io_buffer * src, int src_buffer_size) {
  uint8_t * src_buffer = (uint8_t*)malloc(src_buffer_size);
  if (!src_buffer) {
    printf("[wuffs] Could not allocate src_buffer");
    return 0;
  }

  int first_chunk = 128 * 1024; // 131072

  // if this is a big GIF, then increase size of first chunk, otherwise we'll get short read on the first frame
  fseek(fp, 0, SEEK_END);
  size_t file_size = ftell(fp);
  fseek(fp, 0, SEEK_SET);

  if (file_size <= first_chunk) {
    first_chunk = file_size;
  } else if (file_size > 10000000) {
    first_chunk *= 4;
  } else if (file_size > 1000000) {
    first_chunk *= 2;
  }

  // printf("file_size: %ld, first chunk: %d\n", file_size, first_chunk);
  src->data.ptr = src_buffer;
  src->data.len = src_buffer_size;
  src->meta.wi = 0;
  src->meta.ri = 0;
  src->meta.pos = 0;
  src->meta.closed = false;

  int last_read = wuffs_read_bytes(fp, first_chunk, src);
  if (last_read <= 0) {
    printf("[wuffs] Unable to read data\n");
    return 0;
  }

  return 1;
}

// int wuffs_decode_gif(const char * filename, void(on_frame)(uint32_t, uint32_t, uint32_t, uint8_t *, uint32_t), void(on_end)(uint32_t, uint32_t, uint32_t, uint8_t *, uint32_t)) {
// int wuffs_decode_gif(const char * filename, void(on_frame)(uint32_t, uint32_t, uint32_t, uint8_t *, uint32_t), void(on_end)(void)) {
int wuffs_decode_gif_file(const char * filename, int(on_frame)(uint32_t, uint32_t, uint32_t, uint8_t *, uint32_t, uint32_t)) {

  int res = 0;
  decoder_instance instance;
  wuffs_base__io_buffer src;

  FILE * fp = fopen(filename, "rb");
  if (!fp) {
    printf("Can't open %s\n", filename);
    return -1;
  }

  if (!wuffs_chunk_reader(fp, &src, SRC_BUFFER_SIZE)) {
    printf("[wuffs] Unable to init chunk reader\n");
    res = -1;
    goto end;
  }

  if (!wuffs_init_instance(&instance, &src, 0)) {
    printf("[wuffs] Unable to init decoder\n");
    res = -1;
    goto end;
  }

  wuffs_base__flicks delay_micros;
  int decoding = 1, decode_res = 0, frames = 0;
  uint32_t io_position;

  int last_read = 1;
  while (decoding) {
    decode_res = wuffs_decode_next_frame(&instance);
    if (decode_res < 0) break; // error decoding
    else if (decode_res == 0) decoding = 0;

    delay_micros = (1000 * wuffs_base__frame_config__duration(&instance.fc)) / WUFFS_BASE__FLICKS_PER_MILLISECOND;
    // printf("delay micros: %ld\n", delay_micros);
    // TODO: should a zero duration mean to show this frame forever?

    io_position = wuffs_base__frame_config__io_position(&instance.fc);
    if (on_frame(frames++, instance.width, instance.height, instance.curr_dst_buffer, io_position, delay_micros) != 0) {
      printf("stop requested!\n");
      break; // stop requested
    }

    if (last_read > 0) {
      last_read = wuffs_read_bytes(fp, DEFAULT_BYTES_PER_CHUNK, &instance.src);
      if (last_read < 0) break; // error reading
    }
  }

  printf("Done, frames read: %d\n", frames-1);

  // bool g_still_image = wuffs_gif__decoder__num_decoded_frame_configs(&dec) <= 1;
  // uint32_t g_num_loops_remaining = wuffs_gif__decoder__num_animation_loops(&dec);

  // if (g_still_image > 0) printf("g_still_image: %d\n", g_still_image);
  // if (g_num_loops_remaining > 0) printf("g_num_loops_remaining: %d\n", g_num_loops_remaining);

  // on_end(frames-1, width, height, instance.curr_dst_buffer, delay_micros);
  // on_end();

  wuffs_free_instance(&instance, 1);

end:
  fclose(fp);
  return res;
}

int wuffs_decode_gif_data(uint8_t* data, int data_size, int(on_frame)(uint32_t, uint32_t, uint32_t, uint8_t *, uint32_t, uint32_t)) {
  decoder_instance instance;

  wuffs_base__io_buffer src;
  src.data.ptr = data;
  src.data.len = data_size;
  src.meta.wi = data_size;
  src.meta.ri = 0;
  src.meta.pos = 0;
  src.meta.closed = true;

  if (!wuffs_init_instance(&instance, &src, 0)) {
    printf("[wuffs] Unable to init decoder\n");
    return -1;
  }

  wuffs_base__flicks delay_micros;
  int decoding = 1, decode_res = 0, frames = 0;

  while (decoding) {
    decode_res = wuffs_decode_next_frame(&instance);
    if (decode_res < 0) break; // error decoding
    else if (decode_res == 0) decoding = 0;

    delay_micros = (1000 * wuffs_base__frame_config__duration(&instance.fc)) / WUFFS_BASE__FLICKS_PER_MILLISECOND;
    if (on_frame(frames++, instance.width, instance.height, instance.curr_dst_buffer, src.meta.ri, delay_micros) != 0) {
      printf("[wuffs] Stop requested!\n");
      break; // stop requested
    }
  }

  printf("done, frames read: %d\n", frames-1);
  wuffs_free_instance(&instance, 0);

  return 0;
}

int dump_frame_to_pbm(uint32_t frame_number, uint32_t width, uint32_t height, uint8_t* rgba_data, uint32_t delay_micros) {
  // printf("got frame: %d\n", frame_number);
  if (frame_number > 0) return 0;
  const char * filename = "frame.pbm";

  FILE * f = fopen(filename, "wb");
  if (f == NULL) {
    printf("Unable to open file for writing\n");
    return -1;
  }

  fprintf(f, "P3\n%d %d\n255\n", width, height);
  uint8_t* d = rgba_data;
  for (uint32_t y = 0; y < height; y++) {
    for (uint32_t x = 0; x < width; x++) {
      fprintf(f, "%d %d %d\n", d[0], d[1], d[2]);
      d += 4;
    }
  }
  fclose(f);
  printf("Wrote file: %s!\n", filename);
  return 0;
}

